  ?state a dbo:Country ;
         dbo:country ?country ;
         dbo:populationDensity ?populationDensity .
  FILTER(?country = <http://dbpedia.org/resource/United_States>)
}
ORDER BY DESC(?populationDensity)
LIMIT 1

